import { Button, Card, Container } from 'react-bootstrap';

function HomePage() {
  return (
    <Container>
      <Card className="p-5 ml-2 mr-2 mt-5">
        <ol><Button variant="outline-primary">Home</Button></ol>
        <ol><a href="/pf">Portfolio</a></ol>
        <ol><a href="/about-me">About Me</a></ol>
      </Card>
    </Container>

  );
}

export default HomePage;
